define([],function(){return{countdown:function(a){setInterval(function(){var b=Math.round((new Date).getTime()/1e3),c=a-b,d=Math.floor(c%86400/3600),e=Math.floor(c%3600/60),f=Math.floor(c%60),g=document.getElementById("timer");g.innerHTML=d.toString().padStart(2,"0")+":"+e.toString().padStart(2,"0")+":"+f.toString().padStart(2,"0")},1e3)},countup:function(a){setInterval(function(){var b=Math.round((new Date).getTime()/1e3),c=b-a,d=Math.floor(c%86400/3600),e=Math.floor(c%3600/60),f=Math.floor(c%60),g=document.getElementById("timer");g.innerHTML=d.toString().padStart(2,"0")+":"+e.toString().padStart(2,"0")+":"+f.toString().padStart(2,"0")},1e3)}}});